import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Search, Filter, BookOpen, ChevronRight } from 'lucide-react';
import DashboardLayout from '../components/layout/DashboardLayout';

const Glossary = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('all');

  const categories = [
    { id: 'all', name: 'All Terms' },
    { id: 'contract', name: 'Contract Law' },
    { id: 'property', name: 'Property Law' },
    { id: 'corporate', name: 'Corporate Law' },
    { id: 'criminal', name: 'Criminal Law' }
  ];

  const terms = [
    {
      term: 'Consideration',
      definition: 'Something of value exchanged between parties to a contract.',
      category: 'contract'
    },
    {
      term: 'Easement',
      definition: 'A right to cross or otherwise use someone else\'s land for a specified purpose.',
      category: 'property'
    },
    {
      term: 'Fiduciary Duty',
      definition: 'A legal obligation to act in the best interest of another party.',
      category: 'corporate'
    },
    {
      term: 'Mens Rea',
      definition: 'The mental state of a person who commits a crime.',
      category: 'criminal'
    }
  ];

  const filteredTerms = terms.filter(term => {
    const matchesSearch = term.term.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         term.definition.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesCategory = selectedCategory === 'all' || term.category === selectedCategory;
    return matchesSearch && matchesCategory;
  });

  return (
    <DashboardLayout>
      <div className="p-6 max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          className="mb-8"
        >
          <h1 className="text-3xl font-bold text-gray-900 mb-2">Legal Glossary</h1>
          <p className="text-gray-600">Search and learn about legal terms and definitions</p>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-4 gap-6">
          {/* Search and Filters */}
          <div className="lg:col-span-1 space-y-4">
            <div className="bg-white rounded-xl shadow-sm p-4">
              <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-5 h-5" />
                <input
                  type="text"
                  placeholder="Search terms..."
                  value={searchTerm}
                  onChange={(e) => setSearchTerm(e.target.value)}
                  className="w-full pl-10 pr-4 py-2 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />
              </div>
            </div>

            <div className="bg-white rounded-xl shadow-sm p-4">
              <div className="flex items-center mb-4">
                <Filter className="w-5 h-5 text-gray-400 mr-2" />
                <h3 className="font-medium text-gray-900">Categories</h3>
              </div>
              <div className="space-y-2">
                {categories.map(category => (
                  <button
                    key={category.id}
                    onClick={() => setSelectedCategory(category.id)}
                    className={`w-full text-left px-3 py-2 rounded-lg transition-colors duration-200 ${
                      selectedCategory === category.id
                        ? 'bg-blue-50 text-blue-600'
                        : 'text-gray-600 hover:bg-gray-50'
                    }`}
                  >
                    {category.name}
                  </button>
                ))}
              </div>
            </div>
          </div>

          {/* Terms List */}
          <div className="lg:col-span-3">
            <div className="bg-white rounded-xl shadow-sm divide-y divide-gray-100">
              {filteredTerms.map((term, index) => (
                <motion.div
                  key={term.term}
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.5, delay: index * 0.1 }}
                  className="p-6 hover:bg-gray-50 transition-colors duration-200"
                >
                  <div className="flex items-start">
                    <div className="flex-shrink-0 bg-blue-100 rounded-lg p-3">
                      <BookOpen className="w-6 h-6 text-blue-600" />
                    </div>
                    <div className="ml-4 flex-1">
                      <h3 className="text-lg font-semibold text-gray-900 mb-1">{term.term}</h3>
                      <p className="text-gray-600 mb-3">{term.definition}</p>
                      <div className="flex items-center text-sm text-gray-500">
                        <span className="capitalize">{term.category}</span>
                        <ChevronRight className="w-4 h-4 mx-2" />
                        <span>Learn more</span>
                      </div>
                    </div>
                  </div>
                </motion.div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </DashboardLayout>
  );
};

export default Glossary;
